const Home = () => {
  const handleclick = () => {
    console.log("hello, ninjas");
  };

  const handleclickAgian = (name) => {
    console.log("hello" + name);
  };

  return (
    <div className="Home">
      <h1> Homepage</h1>
      <button on onClick={handleclick}>
        click me
      </button>
      <butten
        onclick={() => {
          console.log("hello");
        }}
      >
        click me agian
      </butten>
    </div>
  );
};

export default Home;
